import style from './Rodape.module.scss'

export const Rodape = () => {
    
    const ano = new Date().getFullYear()

    return(
        <>
            <footer className={style.rodape}>
                <h1>CRDD/RS - {ano} </h1>
            </footer>
        </>
    )
}
